import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Spinner from "./Spinner";
import { log } from "console";

function Result() {
  const { id } = useParams();
  const [detectionData, setDetectionData] = useState("null");
  useEffect(() => {
    fetch("http://86.125.224.208/recog/" + id)
      .then((response) => response.json())
      .then((data) => {
        setDetectionData(data);
      });
  }, []);
  console.log(detectionData);

  return (
    <>
      {detectionData === "null" ? (
        <Spinner />
      ) : (
        <section className="result">
          <div className="contianer">
            <div className="row">
              <div className="col-md-6">
                <table>
                  <tbody>
                    {detectionData === "null" ? (
                      <Spinner />
                    ) : (
                      <>
                        <tr>
                          <td>File Name:</td>
                          <td>{(detectionData as any).fname}</td>
                        </tr>
                        <tr>
                          <td>Recognition Name:</td>
                          <td>{(detectionData as any).recognitionName}</td>
                        </tr>
                        <tr>
                          <td>Recognition Confidence:</td>
                          <td>{(detectionData as any).recognitionConf}</td>
                        </tr>
                        {(detectionData as any).recognitionConf != null && (
                          <> <tr>
                          <td>Error:</td>
                          <td>{(detectionData as any).recognitionConf}</td>
                        </tr></>
                        )}
                      </>
                    )}
                  </tbody>
                </table>
              </div>
              <div className="col-md-6">
                <img
                  src={`http://86.125.224.208/file/${
                    (detectionData as any).fname
                  }`}
                ></img>
              </div>
            </div>
          </div>
        </section>
      )}
    </>
  );
}

export default Result;
